use std::sync::Arc;
use parking_lot::RwLock; /// The 12,288-site lattice with efficient memory layout
#[repr(C, align(64))] // Cache-line aligned
pub struct Lattice { /// Raw data storage - exactly 12,288 bytes data: [u8; 12_288], /// Metadata for fast operations metadata: LatticeMetadata, /// Version for optimistic concurrency version: AtomicU64,
} impl Lattice { /// Constants for lattice dimensions pub const PAGES: usize = 48; pub const BYTES_PER_PAGE: usize = 256; pub const TOTAL_SITES: usize = Self::PAGES * Self::BYTES_PER_PAGE; /// Create empty lattice pub fn new() -> Self { Self { data: [0; Self::TOTAL_SITES], metadata: LatticeMetadata::default(), version: AtomicU64::new(0), } } /// Efficient site indexing #[inline(always)] pub fn site_to_index(page: u8, byte: u8) -> usize { ((page as usize) % Self::PAGES) * Self::BYTES_PER_PAGE + ((byte as usize) % Self::BYTES_PER_PAGE) } /// Index to site conversion #[inline(always)] pub fn index_to_site(index: usize) -> (u8, u8) { let index = index % Self::TOTAL_SITES; ((index / Self::BYTES_PER_PAGE) as u8, (index % Self::BYTES_PER_PAGE) as u8) } /// Get value at site with bounds checking #[inline] pub fn get(&self, page: u8, byte: u8) -> u8 { self.data[Self::site_to_index(page, byte)] } /// Set value at site #[inline] pub fn set(&mut self, page: u8, byte: u8, value: u8) { let index = Self::site_to_index(page, byte); self.data[index] = value; self.version.fetch_add(1, Ordering::SeqCst); self.metadata.mark_dirty(index); } /// Bulk operations for efficiency pub fn apply_morphism(&mut self, morphism: &Morphism) { // Pre-compute affected sites let affected = morphism.affected_sites(); // Batch updates for &site in &affected { let old_value = self.data[site]; let new_value = morphism.apply_to_byte(old_value); self.data[site] = new_value; } // Single version increment self.version.fetch_add(1, Ordering::SeqCst); self.metadata.bulk_mark_dirty(&affected); }
} /// Metadata for optimization
#[derive(Default)]
struct LatticeMetadata { /// Dirty tracking for incremental computation dirty_bits: BitVec, /// R96 histogram cache r96_histogram: [u32; 96], /// Active region bounds active_min: usize, active_max: usize, /// Occupancy count non_zero_count: usize,
} impl LatticeMetadata { fn mark_dirty(&mut self, index: usize) { self.dirty_bits.set(index, true); self.active_min = self.active_min.min(index); self.active_max = self.active_max.max(index); } fn bulk_mark_dirty(&mut self, indices: &[usize]) { for &i in indices { self.dirty_bits.set(i, true); } // Update bounds efficiently if let (Some(&min), Some(&max)) = (indices.iter().min(), indices.iter().max()) { self.active_min = self.active_min.min(min); self.active_max = self.active_max.max(max); } }
}

