pub struct ConfigurationRingBuffer { /// Fixed-size buffer buffer: Vec<Configuration>, /// Write position write_pos: AtomicUsize, /// Read position read_pos: AtomicUsize, /// Capacity (power of 2 for fast modulo) capacity: usize, /// Mask for fast modulo (capacity - 1) mask: usize,
} impl ConfigurationRingBuffer { pub fn new(capacity_power_of_two: usize) -> Self { let capacity = 1 << capacity_power_of_two; Self { buffer: vec![Configuration::default(); capacity], write_pos: AtomicUsize::new(0), read_pos: AtomicUsize::new(0), capacity, mask: capacity - 1, } } /// Non-blocking write pub fn try_write(&self, config: Configuration) -> bool { let write = self.write_pos.load(Ordering::Acquire); let read = self.read_pos.load(Ordering::Acquire); // Check if full if (write - read) >= self.capacity { return false; } // Write to buffer let index = write & self.mask; unsafe { // Safe because we checked bounds let slot = &self.buffer[index] as *const _ as *mut Configuration; slot.write(config); } // Advance write position self.write_pos.store(write + 1, Ordering::Release); true } /// Non-blocking read pub fn try_read(&self) -> Option<Configuration> { let read = self.read_pos.load(Ordering::Acquire); let write = self.write_pos.load(Ordering::Acquire); // Check if empty if read >= write { return None; } // Read from buffer let index = read & self.mask; let config = unsafe { // Safe because we checked bounds self.buffer[index].clone() }; // Advance read position self.read_pos.store(read + 1, Ordering::Release); Some(config) }
