/// Merkle tree for efficient witness verification
pub struct WitnessMerkleTree { /// Leaf nodes (witness fragments) leaves: Vec<WitnessFragment>, /// Internal nodes nodes: Vec<[u8; 32]>, /// Tree depth depth: usize,
} impl WitnessMerkleTree { pub fn build(witnesses: Vec<WitnessFragment>) -> Self { let n = witnesses.len(); let depth = (n as f64).log2().ceil() as usize; let padded_size = 1 << depth; // Pad to power of 2 let mut leaves = witnesses; leaves.resize(padded_size, WitnessFragment::default()); // Build tree bottom-up let mut nodes = Vec::with_capacity(padded_size - 1); let mut current_level: Vec<[u8; 32]> = leaves .iter() .map(|w| w.hash()) .collect(); while current_level.len() > 1 { let mut next_level = Vec::new(); for chunk in current_level.chunks(2) { let hash = Self::hash_pair(&chunk[0], &chunk[1]); nodes.push(hash); next_level.push(hash); } current_level = next_level; } Self { leaves, nodes, depth } } /// Generate inclusion proof pub fn inclusion_proof(&self, index: usize) -> Vec<[u8; 32]> { let mut proof = Vec::with_capacity(self.depth); let mut current = index; let mut level_start = 0; let mut level_size = self.leaves.len(); for _ in 0..self.depth { let sibling = current ^ 1; // Flip last bit if sibling < level_size { let sibling_hash = if level_start == 0 { self.leaves[sibling].hash() } else { self.nodes[level_start + sibling - self.leaves.len()] }; proof.push(sibling_hash); } current /= 2; level_start += level_size; level_size /= 2; } proof } fn hash_pair(left: &[u8; 32], right: &[u8; 32]) -> [u8; 32] { let mut hasher = Hasher::new(); hasher.update(left); hasher.update(right); hasher.finalize().into() }
}

