// lattice.rs - The 12,288 lattice structure
use std::ops::{Index, IndexMut}; pub const PAGES: usize = 48;
pub const BYTES_PER_PAGE: usize = 256;
pub const LATTICE_SIZE: usize = PAGES * BYTES_PER_PAGE; // 12,288 #[derive(Clone, Debug)]
pub struct Lattice { data: Vec<u8>,
} impl Lattice { pub fn new() -> Self { Lattice { data: vec![0; LATTICE_SIZE], } } pub fn from_vec(data: Vec<u8>) -> Self { assert_eq!(data.len(), LATTICE_SIZE); Lattice { data } } pub fn get(&self, page: u8, byte: u8) -> u8 { let index = (page as usize) * 256 + (byte as usize); self.data[index] } pub fn set(&mut self, page: u8, byte: u8, value: u8) { let index = (page as usize) * 256 + (byte as usize); self.data[index] = value; } pub fn linear_index(page: u8, byte: u8) -> usize { (page as usize) * 256 + (byte as usize) } pub fn from_linear_index(index: usize) -> (u8, u8) { let page = (index / 256) as u8; let byte = (index % 256) as u8; (page, byte) } pub fn iter(&self) -> impl Iterator<Item = &u8> { self.data.iter() }
} impl Index<(u8, u8)> for Lattice { type Output = u8; fn index(&self, (page, byte): (u8, u8)) -> &u8 { &self.data[Self::linear_index(page, byte)] }
} impl IndexMut<(u8, u8)> for Lattice { fn index_mut(&mut self, (page, byte): (u8, u8)) -> &mut u8 { let index = Self::linear_index(page, byte); &mut self.data[index] }
}

