pub trait Morphism { fn apply(&self, lattice: &Lattice) -> Lattice; fn budget_cost(&self) -> u8; fn receipt(&self, input: &Lattice, output: &Lattice) -> Receipt;
} pub struct IdentityMorphism; impl Morphism for IdentityMorphism { fn apply(&self, lattice: &Lattice) -> Lattice { lattice.clone() } fn budget_cost(&self) -> u8 { 0 } fn receipt(&self, input: &Lattice, _output: &Lattice) -> Receipt { Receipt::compute(input, 0) }
