pub struct Verifier { window_size: usize,
} impl Verifier { pub fn new(window_size: usize) -> Self { Verifier { window_size } } pub fn verify_window(&self, lattice: &Lattice, start: usize) -> bool { let end = (start + self.window_size).min(LATTICE_SIZE); let window_data: Vec<u8> = lattice.data[start..end].to_vec(); // Verify R96 conservation let r96 = R96Digest::compute(&window_data); if !self.verify_r96_conservation(&r96) { return false; } // Verify budget is zero (lawful) let receipt = Receipt::compute(lattice, 0); receipt.verify() } fn verify_r96_conservation(&self, digest: &R96Digest) -> bool { // Check that histogram sums to window size let total: u32 = digest.histogram.iter().sum(); total as usize == self.window_size } pub fn verify_witness_chain(&self, witnesses: &[Witness]) -> bool { if witnesses.is_empty() { return true; } let mut current_receipt = witnesses[0].input_receipt.clone(); for witness in witnesses { if witness.input_receipt != current_receipt { return false; // Chain broken } if !witness.verify() { return false; // Invalid witness } current_receipt = witness.output_receipt.clone(); } true }
} #[derive(Clone, Debug)]
pub struct Witness { pub morphism_id: String, pub input_receipt: Receipt, pub output_receipt: Receipt, pub budget_delta: u8,
} impl Witness { pub fn verify(&self) -> bool { // Verify budget conservation let expected_budget = (self.input_receipt.budget_ledger + self.budget_delta) % 96; self.output_receipt.budget_ledger == expected_budget }
}

